const HomeCarousel = ({ section }) => {
  const sectionNumber = section + 1;
  const images = Array.from({ length: 20 }, (_, index) => {
    const imageNumber = index + 1;
    return `/assets/imgs/home_image_section${sectionNumber}/section${sectionNumber}_image${imageNumber}.jpg`;
  });

  return (
    <div className="home__carrousel__img__rows">
      {images.map((img, index) => (
        <div
          key={index}
          className="image-part-container"
          style={{
            width: `${100 / images.length}%`,
            height: '100%',
            overflow: 'hidden',
            flexShrink: 0,
          }}
        >
          <img
            src={img}
            alt={`Secci칩n ${sectionNumber} - Parte ${index + 1}`}
            className="images-rows"
            onError={(e) => (e.target.style.display = "none")} // Oculta im치genes que no existan
          />
        </div>
      ))}
    </div>
  );
};

export default HomeCarousel;
